import React from 'react';
import SignupPage from './assests/Pages/SignupPage';
import LoginPage from './assests/Pages/LoginPage';
import ErrorPage from './assests/Pages/ErrorPage';
import { BrowserRouter,Routes,Route } from 'react-router-dom';

import "bootstrap/dist/css/bootstrap.min.css";
import HomeExaminateur from "./assets/Pages/HomeExaminateur";
import OnlineExamsView from "./assets/Pages/OnlineExamsView";
import RésultatsExaminateur from "./assets/Pages/RésultatsExaminateur";



const App = () => {
  return (
   <BrowserRouter>

   <Routes>
      {/*<Route path="/" index element={<LoginPage/>} />
      <Route path="/SignUp" element={<SignupPage/>} />
  <Route  path="*" element={<ErrorPage/>}/>*/}

      <Route index element={<HomeExaminateur />} />
      <Route path="/home" element={<HomeExaminateur />} />
      <Route path="/résultats" element={<RésultatsExaminateur />} />
      <Route path="/examens-en-ligne" element={<OnlineExamsView />} /> 
   </Routes>

   </BrowserRouter>
   );
};

export default App;
